import React from 'react';
import {AppBar, Toolbar, IconButton, Badge, MenuItem, Menu, Typography } from '@material-ui/core'
import ShoppingCartSharpIcon from '@material-ui/icons/ShoppingCartSharp';
import useStyles from './style';
import InputBase from '@material-ui/core/InputBase';



const NavBar = () => {
    const classes= useStyles();
    return (
        <div>
            <AppBar position="fixed"  color="inherit">
                <Toolbar>
                    <Typography variant="h6" className={classes.appBar} color="inherit">
                        <img src="https://upload.wikimedia.org/wikipedia/commons/a/ab/Apple-logo.png" alt="logo" height="25px" />
                        Nome Shop
                    </Typography>
                    <InputBase placeholder="Cerca" classes={{ root: classes.inputRoot, input: classes.inputInput, }} inputProps={{ 'aria-label': 'cerca' }}/>
                    <div className={classes.grow}/>
                    <div className={classes.button}>
                        <IconButton aria-label="Mostra i prodotti nel carrello" color="inherit">
                            <Badge badgeContent={2} color="secondary">
                                <ShoppingCartSharpIcon/>
                            </Badge>
                        </IconButton>
                    </div>


                </Toolbar>
            </AppBar>
        </div>
    )
}

export default NavBar
